// Filename - components/array.js

// Javascript object named array 
// with 3 key-values
const array = [
	{
		id: "1",
		Name: "Shivansh",
        Description: "Shivansh Description",
		Address: "Address shivansh",
	},
	{
		id: "2",
		Name: "Simran",
        Description: "Simran Description",
		Address: "Address Simran",
	},
	{
		id: "3",
		Name: "Aakash",
        Description: "Aakash Description",
		Address: "23",
	},
];


export default array;
